import React from 'react'

const WorkoutItem = (props) => {
    return (
        <React.Fragment>
            <div className="itemContainer">
                <>
                    Leg Press
            </>
                <>
                    4x12
            </>
            </div>
            <style jsx>{`
                .itemContainer{
                    border-bottom: #C4C4C4 1px solid;
                    margin-bottom: 10px;

                    display: flex;
                    justify-content: space-between;
                }

            `}</style>
        </React.Fragment>
    )
}

export default WorkoutItem
